import React, { useEffect, useState } from 'react';

import './userLogin.css';

import UserForm from '../../items/userForm/userForm';
import UserErrorMessage from '../../items/userErrorMessage/userErrorMessage';
import { setUserAction } from '../../store/actions/userAction';
import { useDispatch } from 'react-redux';

const UserLogin = () => {
  const dispatch = useDispatch();
  const [userData, setUserData] = useState({});
  useEffect(() => {
    setUserAction(userData)(dispatch);
  }, [userData]);

  return (
    <section className="userLogin">
      <div className="userSing">
        <UserForm data={setUserData} />
        <UserErrorMessage />
      </div>
    </section>
  );
};

export default UserLogin;
